export default function Profile() {
  return (
    <div id="profileHead">
      <h2>Pancho Rodriguez</h2>
      <h4>Fullerton, CA</h4>
      <img href="" alt="" src={stars}/>
      <h4>2 Reviews</h4>
      <p>test</p>
    </div>
  )
}
